/*
* custom javascript for the NDepend reports
* by Michal Novacek
* September 9, 2013
*/
(function () {
    "use strict";
    var NDJS = {
        init: function () {
            $(document).ready(NDJS.ready);
            //check if google charts can be loaded
            if (typeof google != 'undefined') {
                //load the google charts, set an onload callback function
                google.load("visualization", "1", { packages: ["corechart"] });
                google.setOnLoadCallback(NDJS.setChartReady);
            } else {
                NDJS.offline = 1;
            }
            //modify the dataTables sorting functions
            NDJS.customSort();
        },
        ready: function () {
            //left hand menu behavior
            NDJS.handleMenu();
            //bind navigation events on the breadcrumb and menu
            NDJS.navigatePages();
            //initiate dataTables on the homepage
            NDJS.initDatatables();
            //initiate the colorbox on a list of links
            NDJS.initColorbox();
            //detect hash changes to navigate hidden ndependPages
            $(window).on('hashchange', NDJS.navigatePages);
        },
        customSort: function () {
            //modify column type detection to add a custom sorting function formatted-num
            jQuery.fn.dataTableExt.aTypes.unshift(
                function (sData) {

                    var deformatted = sData.replace(/[^\d\-\.\/a-zA-Z]/g, '');
                    deformatted = deformatted.replace('N/A', -999999);
                    if ($.isNumeric(deformatted) || deformatted === "-") {
                        return 'formatted-num';
                    }
                    return null;
                }
            );
            //sorting function formatted-num for int columns that contain formatting or N/A
            jQuery.extend(jQuery.fn.dataTableExt.oSort, {
                "formatted-num-pre": function (a) {
                    if (a === "-") {
                        return 0;
                    }
                    if (a === 'N/A') {
                        return 999999;
                    }
                    a = a.replace(/[^\d\-\.]/g, "");
                    return parseFloat(a);
                },

                "formatted-num-asc": function (a, b) {
                    return a - b;
                },

                "formatted-num-desc": function (a, b) {
                    return b - a;
                }
            });
        },
        handleMenu: function () {
            NDJS.cache.menu = $('#Menu');
            NDJS.cache.menuli = $('#Menu').find('li');
            NDJS.cache.menu.on('click', 'a', function (e) {
                e.preventDefault();
            });
            NDJS.cache.menu.prepend("<div class='back'><span class='arrow'></span>Back</div>");
            NDJS.cache.menu.find(' > ul').addClass('root');
            //back button behavior
            NDJS.cache.menu.on('click', '.back', function () {
                var activepath = NDJS.cache.menu.find('li.active');
                activepath.last().removeClass('active');
                activepath.last().siblings().show();
                if (activepath.length == 1) {
                    NDJS.cache.menu.find('.back').removeClass('active');
                }
            });
            //menu item behavior
            NDJS.cache.menu.on('click', 'li', function () {
                if ($(this).find('> a').length > 0) {
                    var target = $(this).find('> a').attr('href');
                    if (target != '#') {
                        window.location.hash = target;
                    }
                }
                if ($(this).find('ul').length > 0) {
                    $(this).siblings().hide();
                    $(this).addClass('active');
                    NDJS.cache.menu.find('.back').addClass('active');
                }
                return false;
            });
            //breadcrumb behavior
            $('#divNavBars').on('click', 'a', function (e) {
                e.preventDefault();
                var target = $(this).attr('href');
                if (target != '#') {
                    window.location.hash = target;
                }
            });
        },
        navigatePages: function () {
            var hash = window.location.hash;
            var navbar = {};
            if (hash) {
                if (hash.match('#Query')) {
                    if (($(hash).length) == 0) {
                        hash = window.location.hash.replace('#', '#GroupOfQueries');
                    }
                    var div = $(hash);
                    //display the parent screen of query report, update breadcrumb and menu, initiate datatables
                    if (!div.parents('.ndependScreen').is(':visible')) {
                        NDJS.cache.screen = div.parents('.ndependScreen');
                        $('.ndependNavbar').hide();
                        navbar = $('#ndependNavbar-' + NDJS.cache.screen.attr('id'));
                        navbar.show();
                        $('.ndependScreen').hide();
                        NDJS.cache.screen.show();
                        NDJS.initDatatables();
                    }
                    window.scrollTo(0, div.offset().top);
                } else {
                    //display report screen
                    $('.ndependNavbar').hide();
                    navbar = $(hash.replace('#', '#ndependNavbar-'));
                    navbar.show();
                    NDJS.cache.screen = $(hash);
                    $('.ndependScreen').hide();
                    NDJS.cache.screen.show();
                    NDJS.initDatatables();
                    window.scrollTo(0, 0);
                    if (hash.match('#TrendCharts')) {
                        NDJS.googleChart();
                    }
                }
            } else {
                //no hash = display homepage
                navbar = $('#ndependNavbar-Main');
                NDJS.cache.screen = $('#Main');
                NDJS.cache.screen.show();
                location.replace("#Main");
                navbar.show();
            }
            //update menu based on the hash to show current navigation path
            var activemenu = NDJS.cache.menu.find("a[href='#" + NDJS.cache.screen.attr('id') + "']");
            NDJS.cache.menuli.removeClass('current').removeClass('active');
            activemenu.parents('li').addClass('current');
            NDJS.cache.menuli.show();
            activemenu.parent().parents('li').each(function () {
                $(this).addClass('active');
                $(this).siblings().hide();
            });
            if (activemenu.parents('li').length > 1) {
                NDJS.cache.menu.find('.back').addClass('active');
            } else {
                NDJS.cache.menu.find('.back').removeClass('active');
            }
        },
        initColorbox: function () {
            $("a.diagramImage").colorbox({ width: "98%", height: "98%", opacity: 0.8 });
            // colorboxes for mainpage diagrams
            $("#AbstractnessVersusInstabilityOnlineLink").colorbox({ width: "80%", height: "80%", iframe: true });
            $("#DependenciesDiagramOnlineLink").colorbox({ width: "80%", height: "80%", iframe: true });
            $("#TreemapOnlineLink").colorbox({ width: "80%", height: "80%", iframe: true });
            // colorboxes for inlined help text
            $("#AbstractnessVersusInstabilityHelp").colorbox({ width: "50%", inline: true, href: "#inline_AbstractnessVersusInstability" });
            $("#DependenciesDiagramHelp").colorbox({ width: "50%", inline: true, href: "#inline_DependenciesDiagram" });
            $("#DependenciesMatrixHelp").colorbox({ width: "50%", inline: true, href: "#inline_DependenciesMatrix" });
            $("#TreemapHelp").colorbox({ width: "50%", inline: true, href: "#inline_Treemap" });
            $("#QuickTipsMain").colorbox({ width: "50%", inline: true, href: "#inline_QuickTipsMain" });
            $("#ForBeginnersMain").colorbox({ width: "50%", inline: true, href: "#inline_ForBeginnersMain" });
            $("#RecentViolationsOnlyONHelp").colorbox({ width: "50%", inline: true, href: "#inline_RecentViolationsOnlyONHelp" });
            $("#RecentViolationsOnlyOFFHelp").colorbox({ width: "50%", inline: true, href: "#inline_RecentViolationsOnlyOFFHelp" });
            $("#ApplicationStatsHelp").colorbox({ width: "50%", inline: true, href: "#inline_ApplicationStats" });
            $("#AssembliesStatsHelp").colorbox({ width: "50%", inline: true, href: "#inline_AssembliesStats" });
            $("#TypesStatsHelp").colorbox({ width: "50%", inline: true, href: "#inline_TypesStats" });

            $("a[data-ref='TruncatedQueryResult']").colorbox({ width: "50%", inline: true, href: "#inline_TruncatedQueryResult" });
            $("a[data-ref='NONTruncatedQueryResult']").colorbox({ width: "50%", inline: true, href: "#inline_NONTruncatedQueryResult" });
            $("a[data-ref='RecentViolationsONLY']").colorbox({ width: "50%", inline: true, href: "#inline_RecentViolationsONLY" });

            $(document).bind('cbox_complete', function () { $.colorbox.resize(); });
        },
        initDatatables: function () {
            //main tables
            NDJS.cache.screen.find('.ndependGrid').not('.dataTable').dataTable({
                "sPaginationType": "full_numbers",
                "aaSorting": [],
                "iDisplayLength": 25,
                "oLanguage": {
                    "sLengthMenu": 'Display <select>' +
                    '<option value="25" selected>25</option>' +
                    '<option value="50">50</option>' +
                    '<option value="100">100</option>' +
                    '<option value="-1">All</option>' +
                    '</select> records'
                }
            });
            //stat tables
            NDJS.cache.screen.find('.ndependStatGrid').not('.dataTable').dataTable({
                "aaSorting": []
            });
            NDJS.handleDropdowns();
        },
        handleDropdowns: function () {
            //if table < 25 entries, do not show paging and size dropdown
            NDJS.cache.screen.find('.dataTables_paginate').not('.checked').each(function () {
                $(this).addClass('checked');
                if ($(this).find('span .paginate_button').length == 0) {
                    $(this).hide();
                    $(this).parent().find('.dataTables_length').hide();
                }
            });
            //custom dropdowns
            NDJS.cache.screen.find('.dataTables_length select').not('.checked').each(function () {
                var originalDropdown = $(this);
                originalDropdown.addClass('checked');
                if (originalDropdown.parent().find('.customDropdown').length == 0) {
                    var customDropdown = document.createElement('span');
                    customDropdown.className = 'customDropdown';
                    $(customDropdown).append("<span class='currentValue'>" + originalDropdown.find('option:selected').text() + "</span>");
                    $(customDropdown).append("<span class='optionWrap'></span>");
                    originalDropdown.find('option').each(function () {
                        var originalOption = $(this);
                        $(customDropdown).find('.optionWrap').append('<span data-value="' + originalOption.val() + '">' + originalOption.text() + '</span>');
                    });
                    originalDropdown.after(customDropdown);
                    $(customDropdown).click(function () {
                        var cdd = $(this);
                        $(this).addClass('active');
                        setTimeout(function () {
                            $('html').one('click', function () {
                                $(customDropdown).removeClass('active');
                            });
                        }, 100);
                    });
                    $(customDropdown).find('.optionWrap span').click(function () {
                        var cdd = $(this).parents('.customDropdown');
                        cdd.find('.currentValue').text($(this).text());
                        cdd.unbind('click');
                        setTimeout(function () {
                            cdd.click(function (e) {
                                $(this).addClass('active');
                                setTimeout(function () {
                                    $('html').one('click', function () {
                                        $(customDropdown).removeClass('active');
                                    });
                                }, 100);
                            });
                        }, 100);
                        var opt = $(this).parents('.dataTables_length').find('select option[value="' + $(this).attr('data-value') + '"]');
                        opt.prop('selected', true);
                        opt.change();
                    });
                }
            });
        },


        googleChart: function () {
            for (var i = 0; i < googleChartGraphDatas.length; i++) {
                var googleChartGraphData = googleChartGraphDatas[i];
                NDJS.googleChartDisplay(googleChartGraphData, 'gchart' + i);
            }
        },

        googleChartDisplay: function (googleChartGraphData, divElementId) {
            if (NDJS.offline == 0) {
                if (NDJS.chartReady == 1) {
                    var data1 = new google.visualization.DataTable(googleChartGraphData.ChartData);
                    var chart1 = new google.visualization.AreaChart(document.getElementById(divElementId));
                    var date_formatter = new google.visualization.DateFormat({ pattern: 'M/d/yyyy H:mm:ss' });
                    date_formatter.format(data1, 0);
                    chart1.draw(data1, googleChartGraphData.Options);
                } else {
                    setTimeout(NDJS.googleChart, 100);
                }
            } else {
                //parse the google chart data and display it as table if offline
                $('#gchart_offline').show();
                var data = googleChartGraphData.ChartData;
                var table = document.createElement('table');
                var thead = document.createElement('thead');
                var tbody = document.createElement('tbody');
                table.className = 'ndependGrid';
                table.cellPadding = 0;
                table.cellSpacing = 0;
                table.border = 0;
                var labels = [];
                var rows = [];
                $(data.cols).each(function (idx) {
                    labels[idx] = this.label;
                });
                labels[0] = "Date";
                labels.pop();
                labels.pop();
                var row = document.createElement('tr');
                $(labels).each(function () {
                    $(row).append('<th>' + this + '</th>');
                })
                $(thead).append(row);
                $(table).append(thead);
                var bodyrows = [];
                $(data.rows).each(function (idx) {
                    bodyrows[idx] = document.createElement('tr');
                    var thisidx = idx;
                    var thisrow = this.c;
                    if (thisrow.length == 8) {
                        thisrow.pop();
                        thisrow[5] = thisrow[6];
                        thisrow.pop();
                    } else {
                        thisrow[5] = thisrow[6];
                        thisrow.pop();
                    }
                    $(thisrow).each(function (idx) {
                        var val = this.v;
                        if (idx == 0) {
                            var newval = '';
                            newval = newval + (val.getMonth() + 1);
                            newval = newval + '/';
                            newval = newval + val.getDate();
                            newval = newval + '/';
                            newval = newval + val.getFullYear();
                            newval = newval + ' ';
                            newval = newval + val.getHours();
                            newval = newval + ':';
                            var mins = val.getMinutes();
                            var secs = val.getSeconds();
                            if (mins < 10) {
                                mins = '0' + mins;
                            }
                            if (secs < 10) {
                                secs = '0' + secs;
                            }
                            newval = newval + mins;
                            newval = newval + ':';
                            newval = newval + secs;
                            val = newval;
                        }
                        $(bodyrows[thisidx]).append('<td>' + val + '</td>');
                    });
                    $(tbody).append(bodyrows[thisidx]);
                });
                $(table).append(tbody);
                $('#' + divElementId).addClass('offline').append(table);
            }
        },

        //callback of the google chart api load function
        setChartReady: function () {
            NDJS.chartReady = 1;
        },
        //cache of jquery selectors
        cache: {
            screen: {},
            menu: {},
            menuli: {}
        },
        offline: 0,
        chartReady: 0
    };
    NDJS.init();
})();